DROP TABLE IF EXISTS `t_mbrc_message_log`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_mbrc_message_log` (
  `MESSAGE_UUID` varchar(32) NOT NULL COMMENT '消息主键',
  `ORGAN_ID` bigint(20) DEFAULT NULL COMMENT '租户ID',
  `USER_ID` bigint(20) DEFAULT NULL COMMENT '用户ID',
  `MESSAGE_TYPE` varchar(1) DEFAULT NULL COMMENT '消息类型  1:系统消息  2:业务消息',
  `MESSAGE_TEXT` text COMMENT '消息内容',
  `MESSAGE_STATUS` varchar(1) DEFAULT NULL COMMENT '消息状态  0:未读 1:已读',
  `MESSAGE_DATE` date DEFAULT NULL COMMENT '创建消息时间',
  `CREATE_BY` bigint(20) DEFAULT NULL COMMENT '记录创建人',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '记录创建时间',
  `UPDATE_BY` bigint(20) DEFAULT NULL COMMENT '记录更新人',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '记录更新时间',
  `UPDATE_TIMESTAMP` datetime DEFAULT NULL COMMENT '记录更新时间戳',
  `CREATE_TIMESTAMP` datetime DEFAULT NULL COMMENT '记录创建时间戳',
  PRIMARY KEY (`MESSAGE_UUID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='消息日志表';
/*!40101 SET character_set_client = @saved_cs_client */;

