CREATE TABLE `t_mbrc_user` (
  `USER_ID` varchar(32) NOT NULL COMMENT '用户ID',
  `PARTITION_INDI` bigint(20) NOT NULL COMMENT '分库ID',
  `USER_NAME` varchar(30) NOT NULL COMMENT '用户名（手机号）',
  `USER_PASSWORD` varchar(128) DEFAULT NULL COMMENT '用户密码',
  `IP_ADDRESS` varchar(20) DEFAULT NULL COMMENT '当前登录IP地址',
  `TIME_OFFSET` bigint(20) DEFAULT '0' COMMENT '用户时间偏移值',
  `CREATE_BY` bigint(20) NOT NULL COMMENT '创建人',
  `CREATE_TIME` datetime NOT NULL COMMENT '创建用户时间',
  `CREATE_TIMESTAMP` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建系统时间',
  `UPDATE_BY` bigint(20) NOT NULL COMMENT '更新人',
  `UPDATE_TIME` datetime NOT NULL COMMENT '更新用户时间',
  `UPDATE_TIMESTAMP` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新系统时间',
  PRIMARY KEY (`USER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会员用户表';
